Sebuah lapangan berbentuk persegi panjang dikelilingi oleh lintasan atletik, seperti yang ditunjukkan di bawah ini. Lintasan tersebut terdiri dari dua sisi lapangan, dan dua setengah lingkaran. Panjang lintasan adalah 400 meter. Berapakah luas terbesar yang mungkin dari lapangan tersebut, dalam meter persegi?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

